{
	if(bsearch(&r, digit2, nelem(digit2), sizeof *digit2, &rune2cmp))
		return 1;
	return 0;
}

int
isalnumrune(Rune r)
{
	return isalpharune(r) || isdigitrune(r);
}

int
isblankrune(Rune r)
{
	return r == ' ' || r == '\t';
}

int
isprintrune(Rune r)
{
	return !iscntrlrune(r) && (r != 0x2028U) && (r != 0x2029U) &&
	       (r < 0xFFF9U) && (r > 0xFFFBU);
}

int
isgraphrune(Rune r)
{
	return !isspacerune(r) && isprintrune(r);
}

int
ispunctrune(Rune r)
{
	return isgraphrune(r) && !isalnumrune(r);
}

int
isxdigitrune(Rune r)
{
	return (r >= '0' && (r - '0') < 10) || (r >= 'a' && (r - 'a') < 6);
}
